import { BrowserRouter as Router,  } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <h1 className="text-3xl font-bold underline">Hello world!</h1>
        <button className="btn">Click</button>
      </div>
    </Router>
  );
}

export default App;
